"use strict";Vue.component("v-header",{template:'\n    <div class="v-header">\n      <div class="label">{{label}}</div>\n      <div class="btn">\n        <slot>\n          <a class="active">全市信用综合分析平台</a>\n          <a>重点人群重点行业分析</a>\n          <a>专项应用分析</a>\n        </slot>\n      </div>\n      <div class="date">{{date}}</div>\n    </div>',props:{label:{type:String,default:"主标题"},activeMenu:{type:Number,default:0}},data:function(){return{date:""}},created:function(){var t=this;this.setTime(),setInterval(function(){t.setTime()},1e3)},methods:{setTime:function(){var t=new Date,e=t.getFullYear(),a=t.getMonth()+1,n=t.getDate(),c=t.getHours(),s=t.getMinutes(),i=t.getSeconds();c<=9&&(c="0"+c),s<=9&&(s="0"+s),i<=9&&(i="0"+i),this.date="".concat(e,"年  ").concat(a,"月").concat(n,"日 ").concat(c,":").concat(s,":").concat(i)}}});